Районы местного самоуправления (РМС; англ. Local Government Area; LGA) — в Австралии название административно-территориальных единиц 2-го уровня, контролируемых органами местного самоуправления. Термин широко используется Австралийским бюро статистики. Юридически статус органов местного самоуправления не закреплён ни в Конституции Австралийского Союза, ни в большинстве конституционных законов штатов. Тем не менее, ответственность за их учреждение и надзор лежит на правительствах австралийских штатов, которые иногда финансируют их деятельность (изредка этим занимается федеральное правительство). В последние годы роль органов местного самоуправления резко возросла, а правительства штатов делегируют им часть своих полномочий. Например, органы районов местного самоуправления Квинсленда наделены правом принятия собственных (местных) законодательных актов (в прошлом они действовала система подзаконных актов). Районы местного самоуправления бывают нескольких типов, каждый из которых имеет своё название. Причём в разных штатах используется разный набор названий. На конец 2009 года известны следующие типы (полужирным выделены РМС, встречающиеся более 30 раз): 
*  Преимущественно городские РМС 
*  городская территория (англ. City (C)) — крупный город с пригородами; 
*  малая городская территория (англ. Town (T) / Town Council) — небольшой город с пригородами; 
*  муниципалитет (англ. Municipality (M) / Municipal Council) — пригороды внутри крупных городов или реже небольшие городки в глуши; 
*  сельско-городская территория (англ. Rural City (RC)) — сформированы в 1994 году путём объединения города («городской территории») и окружающего его (обычно одноимённого) графства; 
*  боро (англ. Borough (B)) — остался всего один. 
*  Преимущественно сельские РМС 
*  графство (англ. Shire (S) / Shire Council (SC) ) — наиболее обычная сельская АЕ в пяти из семи штатов/территорий Австралии; 
*  район (англ. Area (A) / Council (DC)); 
*  (местный) регион (англ. Region (R) / Regional Councils (RegC)) — более урбанизированные районы, находящиеся обычно ближе к побережью, не путать с более крупными неофициальными регионами; 
*  округ (англ. District Council) — аналог графства в Южной Австралии; 
*  островной район (англ. Island Councils (IC) — всего один; 
*  общинный район (англ. Community Government Council (CGC), букв. «Совет управления общиной») — всего один; 
*  аборигенные РМС: 
*  аборигенное графство (Aboriginal Shire) — в Квинсленде, 
*  аборигенный район (англ. Aboriginal Council (AC) — в Южной Австралии. Кроме этого существует некоторые другие типы классификация РМС в Австралии. Многие районы местного самоуправления в штатах Новый Южный Уэльс и Южная Австралия больше не имеют юридического статуса графств или муниципалитетов: они просто известны под названием «район» (англ. Area), а их управы — под названием «советы» (англ. Council). В настоящее время в Австралии 567 районов местного самоуправления и 14 невключённых территорий. Ответственность за создание и определение границ районов местного самоуправления несут правительства штатов и территорий. Во всех австралийских штатах и Северной территории объединённые территории имеют официальный статус.
